import Header from "../Header/Header"
import Footer from "../Footer/Footer"
import BookTable from "../AdminBookPage/BookTable";
import ClientBookPage from "../ClientBookPage/ClientBookPage";

const MainPage = () => {
  return (
    <>
      <Header />
      {
      localStorage.getItem("token") === "client"
       ? 
      (<ClientBookPage />) : (<BookTable />)}
      <Footer />
    </>
  );
};

export default MainPage;
